#include "http_parser.h"
#include <stdint.h>
#include <stdlib.h>
#include <string.h>

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if(size < sizeof(enum http_errno)) {
    return 0;
  }

  enum http_errno httpError;
  memcpy(&httpError, data, sizeof(enum http_errno));

  const char* errorDescription = http_errno_description(httpError);

  return 0;
}

#include <stdint.h>
#include <stddef.h>
#include "http_parser.h"

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size == 0) {
    return 0;
  }

  const enum http_errno errnum = (enum http_errno)(data[0] % HPE_UNKNOWN);
  const char *description = http_errno_description(errnum);

  return 0;
}
